// Triggered token ajax
$.ajaxSetup({
	headers: {
		'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
	}
});

// String processing
function _substr(str, length) {
	if (str.length > length) {
		str = str.substring(0, length) + '...';
		return str;
	}
	return str
}

// Remove character '#_=_' from url after login with facebook and google
if (window.location.hash && window.location.hash == '#_=_') {
	window.location.hash = '';
}
history.pushState('', document.title, window.location.pathname);
if (window.location.hash == '#_=_') window.location.hash = '';

// Fixed footer
$(function () {
	$('.modal').on('show.bs.modal', function () {
		$('.footer').css('left', '-17px');
	});

	$('.modal').on('hide.bs.modal', function () {
		$('.footer').css('left', 0);
	});
});

// Create post
$(function () {
	// Triggered select2
	$(function () {
		$('#topic').select2({
			placeholder: 'Please select a topic for your post'
		});
	});

	var editor = new MediumEditor('.medium-editor', {
		placeholder: false,
		toolbar: {
			buttons: ['bold', 'italic', 'anchor', 'quote', 'h2']
		}
	});

	// Validate data
	var topic = $('#topic');
	var title = $('#title');
	var body = $('.medium-editor-element');
	var btnSubmit = $('#btn-submit');
	btnSubmit.tooltip();

	if (topic.val() != '' && title.val() != '' && body.text() != '') {
		btnSubmit.css('cursor', 'pointer');
		btnSubmit.tooltip('dispose');
	}

	$(btnSubmit).on('click', function (e) {
		if (topic.val() != '' && title.val() != '' && body.text() != '') {
			$('.write-story form').submit();
		} else {
			e.preventDefault();
		}
	});

	$(topic).add(title).add(body).bind('change keyup', function () {
		if (topic.val() != '' && title.val() != '' && body.text() != '') {
			btnSubmit.css('cursor', 'pointer');
			btnSubmit.tooltip('disable');
		} else {
			btnSubmit.css('cursor', 'not-allowed');
			btnSubmit.tooltip('enable');
		}
	});

	$(body).on('keyup', function () {
		$('textarea.medium-editor').text(body.text());
	});

	// Display file name
	$('#file-selector').on('change', function () {
		var fileName = this.files[0].name;
		var shortFileName = fileName.substring(0, 27);
		var fileExtension = fileName.split('.').pop();

		if (fileName.length > 30) {
			$('#file-name').html(shortFileName + '...' + fileExtension);
		} else {
			$('#file-name').html(fileName);
		}
	});

	// Show error
	$('.alert-bar').css('top', '0');
	setTimeout(function () {
		$('.alert-bar').css('top', '-45px'); 
	}, 5000);
});

// Popover user
$(function () {
	$('.popover-trigger').popover({
		trigger: 'manual',
		placement: 'top',
		animation: false,
		html: true,
		content: function () {
			return $(this).parents('.popover-user').find('#popover-content').html();
		}
	}).on('mouseenter', function () {
		var _this = this;
		$(this).popover('show');
		$('.popover').on('mouseleave', function () {
			$(_this).popover('hide');
		});
	}).on('mouseleave', function () {
		var _this = this;
		setTimeout(function () {
			if (!$('.popover:hover').length) {
				$(_this).popover('hide');
			}
		}, 100);
	});
});

// Autosave post
function autoSave() {
    var valTopicId = $('#topic').val();
    var valtitle = $('#title').val();
    var valBody = $('textarea.medium-editor').text();
    var postId = $('#post-id').val();
    var condition = valTopicId != '' && valtitle != '' && valBody != '';

    if (condition && postId == '') {
        $.ajax({
            url: 'posts',
            method: 'POST',
            data: {
                topic_id: valTopicId,
                title: valtitle,
                body: valBody
            },
            success: function (data) {
                $('#post-id').val(data);
                $('form').attr('action', 'posts/' + data);
                $('#topic').parent('.form-group').before('<input type="hidden" name="_method" value="PUT">');
                window.history.pushState('', '', data + '/edit');
            }
        });
    } else if (condition && postId != '') {
        $.ajax({
            url: 'posts/' + postId,
            method: 'PUT',
            data: {
                topic_id: valTopicId,
                title: valtitle,
                body: valBody
            }
        });
    }
}

// Timer autosave post
$(function () {
	var topic = $('#topic');
	var title = $('#title');
	var timer;
	var time = 5000;

	$(title).on('keyup', function () {
		clearTimeout(timer);
		timer = setTimeout(action, time);
	});

	$('body').on('DOMSubtreeModified', 'div.medium-editor', function () {
		clearTimeout(timer);
		timer = setTimeout(action, time);
	});

	$(topic).on('change', function () {
		clearTimeout(timer);
		timer = setTimeout(action, time);
	});

	function action() {
		if (topic.val() != '' && title.val() != '' && $('textarea.medium-editor').text() != '') {
			autoSave();
		}
	}
});

// Confirm delete.
$(document).on('click', '.form-delete', function (e) {
    e.preventDefault();
    var el = $(this);

    $('#confirm').modal().on('click', '.btn-delete', function () {
        el.submit();
    })
});

// Load more data via scroll event
$(function () {
	var page = 1;
	var spinner = $('.spinner');
	var pathname = window.location.pathname;
	var lastPage = $('.last-page').data('page');

	$(window).scroll(function () {
		if ($(window).scrollTop() + $(window).height() >= $(document).height()) {
			page++;
			if (page <= lastPage) {
				loadMoreData(page);
			}
		}
	});

	function loadMoreData(page) {
		$.ajax({
			url: pathname + '/?page=' + page,
			type: 'GET',
			beforeSend: function () {
				spinner.show();
			},
			success: function (data) {
				spinner.hide();
				$('#scroll-data').append(data);
				$('.lazy').lazy();
				$('.popover-trigger').popover({
					trigger: 'manual',
					placement: 'top',
					animation: false,
					html: true,
					content: function () {
						return $(this).parents('.popover-user').find('#popover-content').html();
					}
				}).on('mouseenter', function () {
					var _this = this;
					$(this).popover('show');
					$('.popover').on('mouseleave', function () {
						$(_this).popover('hide');
					});
				}).on('mouseleave', function () {
					var _this = this;
					setTimeout(function () {
						if (!$('.popover:hover').length) {
							$(_this).popover('hide');
						}
					}, 100);
				});
			}
		})
	}
});

// Like
$(document).on('click', '#like', function () {
	var el = $(this);
	var id = el.data('id');
	el.prop('disabled', true);

	if (el.hasClass('post')) {
		var oldCountEl = el.parent('.like-action').find('#count-likes-post');
	} else if (el.hasClass('comment')) {
		var oldCountEl = el.parent('.like-action').find('#count-likes-comment');
	} else {
		var oldCountEl = el.parent('.like-action').find('#count-likes-reply');
	}

	if (el.hasClass('post')) {
		var _url = 'like/post/';
	} else if (el.hasClass('comment')) {
		var _url = 'like/comment/';
	} else {
		var _url = 'like/reply/';
	}

	if (oldCountEl.html() == '') {
		var newCount = 1;
	} else {
		var oldCount = oldCountEl.html();
		var newCount = parseInt(oldCount) + 1;
	}

	if (el.hasClass('post')) {
		var newCountEl = '<span id="count-likes-post" class="ml-3">'+ newCount +'</span>';
	} else if (el.hasClass('comment')) {
		var newCountEl = '<span id="count-likes-comment" class="ml-3">'+ newCount +'</span>';
	} else {
		var newCountEl = '<span id="count-likes-reply" class="ml-3">'+ newCount +'</span>';
	}

	$.ajax({
		url: _url + id,
		type: 'POST',
		success: function (data) {
			if (el.hasClass('post')) {
				el.replaceWith('<button class="btn btn-action btn-shadow bg-danger text-white fade-in-scale post" id="unlike" data-id="'+ id +'" data-like-id="'+ data +'"><i class="fa fa-heart"></i></button>');
			} else if (el.hasClass('comment')) {
				el.replaceWith('<button class="btn btn-action btn-shadow bg-danger text-white fade-in-scal comment" id="unlike" data-id="'+ id +'" data-like-id="'+ data +'"><i class="fa fa-heart"></i></button>');
			} else {
				el.replaceWith('<button class="btn btn-action btn-shadow bg-danger text-white fade-in-scale reply" id="unlike" data-id="'+ id +'" data-like-id="'+ data +'"><i class="fa fa-heart"></i></button>');
			}

			el.prop('disabled', '');
			oldCountEl.replaceWith(newCountEl);
		}
	});
});	

// Unlike
$(document).on('click', '#unlike', function () {
	var el = $(this);
	var id = el.data('id');
	var likeId = el.data('like-id');
	el.prop('disabled', true);

	if (el.hasClass('post')) {
		var oldCountEl = el.parent('.like-action').find('#count-likes-post');
	} else if (el.hasClass('comment')) {
		var oldCountEl = el.parent('.like-action').find('#count-likes-comment');
	} else {
		var oldCountEl = el.parent('.like-action').find('#count-likes-reply');
	}

	var oldCount = parseInt(oldCountEl.html());

	if (oldCount > 1) {
		var newCount = oldCount - 1;

		if (el.hasClass('post')) {
			var newCountEl = '<span id="count-likes-post" class="ml-3">'+ newCount +'</span>';
		} else if (el.hasClass('comment')) {
			var newCountEl = '<span id="count-likes-comment" class="ml-3">'+ newCount +'</span>';
		} else {
			var newCountEl = '<span id="count-likes-reply" class="ml-3">'+ newCount +'</span>';
		}

		if (el.hasClass('post')) {
			var newEl = '<button class="btn btn-shadow btn-action text-danger fade-in-scale post" id="like" data-id="'+ id +'"><i class="fa fa-heart"></i></button>';
		} else if (el.hasClass('comment')) {
			var newEl = '<button class="btn btn-shadow btn-action text-danger fade-in-scale comment" id="like" data-id="'+ id +'"><i class="fa fa-heart"></i></button>';
		} else {
			var newEl = '<button class="btn btn-shadow btn-action text-danger fade-in-scale reply" id="like" data-id="'+ id +'"><i class="fa fa-heart"></i></button>';
		}
	} else {
		if (el.hasClass('post')) {
			var newCountEl = '<span id="count-likes-post"></span>';
		} else if (el.hasClass('comment')) {
			var newCountEl = '<span id="count-likes-comment"></span>';
		} else {
			var newCountEl = '<span id="count-likes-reply"></span>';
		}

		if (el.hasClass('post')) {
			var newEl = '<button class="btn btn-shadow btn-action text-danger fade-in-scale post" id="like" data-id="'+ id +'"><i class="fa fa-heart"></i></button>';
		} else if (el.hasClass('comment')) {
			var newEl = '<button class="btn btn-shadow btn-action text-danger fade-in-scale comment" id="like" data-id="'+ id +'"><i class="fa fa-heart"></i></button>';
		} else {
			var newEl = '<button class="btn btn-shadow btn-action text-danger fade-in-scale reply" id="like" data-id="'+ id +'"><i class="fa fa-heart"></i></button>';
		}
	}

	$.ajax({
		url: 'unlike/' + likeId,
		type: 'POST',
		success: function () {
			el.replaceWith(newEl);
			el.prop('disabled', '');
			oldCountEl.replaceWith(newCountEl);
		}
	});
});

