// Attach
$(document).on('click', '#attach', function () {
	var el = $(this);
	var id = el.data('id');
	el.prop('disabled', true);

	if (el.hasClass('topic')) {
		var _url = 'attach/topic/';
	} else {
		var _url = 'attach/user/';
	}

	$.ajax({
		url: _url + id,
		type: 'POST',
		success: function () {
			if (el.hasClass('topic')) {
				if (el.hasClass('star')) {
					el.replaceWith('<button id="detach" class="btn btn-action circle bg-dark-blue btn-shadow star topic" data-id="'+ id +'"><i class="fa fa-star"></i></button>');
				} else {
					el.replaceWith('<button id="detach" class="btn bg-success btn-shadow topic" data-id="'+ id +'">Subscribed</button>');
				}
			} else {
				$('[data-id="'+ id +'"]').html('Following');
				$('[data-id="'+ id +'"]').removeClass('btn-success').addClass('bg-success btn-shadow');
				$('[data-id="'+ id +'"]').attr('id', 'detach');
			}

			el.prop('disabled', '');
		}
	});
});

