// Area comment
$(function () {
	// Auto resize height textarea.
	$('textarea').each(function () {
		this.setAttribute('style', 'height:' + (this.scrollHeight) + 'px; overflow-y: hidden;');
	}).on('input', function () {
		this.style.height = 'auto';
		this.style.height = (this.scrollHeight) + 'px';
	});

	// Hide and show area comment
	$('.area-comment').hide();

	$('.raw-form').click(function () {
		$(this).hide();
		$('.area-comment').show();
		$('textarea').focus();
	});

	$('.cancel').click(function () {
		$('.area-comment').hide();
		$('.raw-form').show();
	});

	// Typing status
	var textStatus = $('.typing').html();

	$('.area-comment').on('keyup', function () {
		var valTextarea = $('.form-comment').val();

		if (valTextarea == '') {
			$('.typing').html(textStatus);
		} else {
			$('.typing').html('Typing comment...');
		}
	});

	$('.cancel').click(function () {
		$('.typing').html(textStatus);
	});
});

// Comment
$(function () {
	var textStatus = $('.typing').html();

	$('.publish-comment').click(function () {
		var postId = $(this).data('id');
		var body = $('.form-comment');
		var valBody = body.val();
		var rawForm = $('.raw-form');

		$.ajax({
			url: 'post/comment',
			type: 'POST',
			data: {
				post_id: postId,
				body: valBody
			},
			success: function (response) {
				var data =	'<div class="card-shadow mb-5 last-page">'
								+ '<div class="p-3">'
									+ '<div class="d-flex">'
										+ '<div class="d-flex mb-3">'
											+ '<a class="' + response.user_path + '">'
												+ '<img src="' + response.user_path_image + '" class="circle img-40">'
											+ '</a>'
											+ '<div class="d-flex flex-column justify-content-center pl-2">'
												+ '<a href="' + response.user_path + '" class="text-success">' + response.user_name + '</a>'
												+ '<span class="font-size-12">' + response.created_at + '</span>'
											+ '</div>'
										+ '</div>'
									+ '</div>'
									+ '<div class="mb-3 font-serif font-size-18 text-dark">' + response.body + '</div>'
									+ '<div class="d-flex justify-content-between">'
										+ '<div class="d-flex align-items-center like-action">'
											+ '<button class="btn btn-shadow btn-action text-danger fade-in-scale mr-3 comment" id="like" data-id="' + response.id.split('.').join('') + '">'
												+ '<i class="fa fa-heart"></i>'
											+ '</button>'
											+ '<span id="count-likes-comment"></span>'
										+ '</div>'
										+ '<div class="d-flex align-items-center">'
											+ '<button class="fade-in-scale text-default text-default-hover font-size-20 comment" id="bookmark" data-id="' + response.id.split('.').join('') + '">'
												+ '<i class="fa fa-bookmark-o"></i>'
											+ '</button>'
										+ '</div>'
									+ '</div>'
								+ '</div>'
							+ '</div>';

				$('.typing').html(textStatus);
				body.val('');
				$('.area-comment').hide();
				rawForm.show();
				rawForm.after(data);
			}
		});
	});
});

// Load more comments
var page = 1;
var spinner = $('.spinner');
var btn = $('.show-comments');
var pathname = window.location.pathname;
var lastPage = $('.last-page').data('page');
var postId = $('.show-comments').data('id');

btn.click(function () {
	page++;

	$.ajax({
		url:  postId + '/comments/?page=' + page,
		type: 'GET',
		beforeSend: function () {
			btn.hide();
			spinner.show();
		},
		success: function (data) {
			spinner.hide();
			if (page == lastPage) {
				btn.hide();
			} else {
				btn.show();
			}
			$('#data-comments').append(data);
			$('.lazy').lazy();
		}
	})
});

$(function () {
	// Keep the dropdown notifacations
	$('.noti .dropdown-menu').on({
		'click': function(e) {
			e.stopPropagation();
		}
	});

	// Mark all notifications as read
	$('.mark-all-as-read').click(function () {
		var el = $(this);

		$.ajax({
			url: 'mark-all-as-read',
			type: 'GET',
			success: function () {
				el.parents('.noti').find('.badge-noti').remove();
				el.parents('.notifications-feed').find('.noti-item').removeClass('noti-unread');
			}
		});
	});

	// Mark notification as read
	$('.notification').click(function () {
		var id = $(this).data('id');

		$.ajax({
			url: 'mark-as-read/' + id,
			type: 'GET'
		});
	});
});

// Search
$( function() {
	$('#search').autocomplete({
		source: 'autocomplete'
	})
	.autocomplete('instance')._renderItem = function(ul, item) {
		var results;
		if (item.username) {
			results = 	'<div class="d-flex align-items-center">'
							+ '<a href="@' + item.username + '">'
								+ '<img src="storage/users/' + item.avatar + '" class="img-40 circle" title="' + item.name + '">'
							+ '</a>'
							+ '<div class="d-flex flex-column ml-2">'
								+ '<a href="@' + item.username + ' /' + item.slug + '" class="text-dark hover-underline font-weight-bold" title="' + item.title + '">'
									+ _substr(item.title, 30)
								+ '</a>'
								+ '<a href="@' + item.username + '" class="text-success font-size-12" title="' + item.name + '">' + item.name + '</a>'
							+ '</div>'
						+ '</div>';
		} else {
			results = '<div class="text-center">No results found</div>';
		}

		return $('<li>')
		.append(results)
		.appendTo(ul);
	};
});
